Frank,

I am so sorry to hear about your wife. I hope she will be feeling well
again soon. I am sending out positive energy to you & your family.

Andrea

-----Original Message-----
From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf
Of Sumption Frank
Sent: Thursday, June 29, 2006 8:18 AM
To: EVP-ITC@yahoogroups.com
Subject: RE: [EVP-ITC] More voices from the 18th.

Thanks;

 Maybe this stuff was supposed to be more prophetic, since they were
talking about her. Norma had a heart attack over the weekend, into
Monday, we thought she had the flu. They did angioplasty yesterday t5o
open up an artery. Of course after the fact, I got voices that talked
about heart sickness. Maybe the voices I got that said something hit the
Erath were supposed to be something hit her?


 Frank



